import {Component, Input, OnInit} from '@angular/core';
import {Piatto} from "../model/piatto";
import {PiattiServiceService} from "../piatti-service.service";

@Component({
  selector: 'app-sezione-menu-vetrina',
  templateUrl: './sezione-menu-vetrina.component.html',
  styleUrls: ['./sezione-menu-vetrina.component.css']
})
export class SezioneMenuVetrinaComponent implements OnInit{
  antipasto?:Piatto[]
  primo?:Piatto[]
  secondo?:Piatto[]
  contorno?:Piatto[]
  dolce?:Piatto[]
  senzaLattosio?:Piatto[]
  senzaGlutine?:Piatto[]
  bevanda?:Piatto[]




  constructor(private piattiService:PiattiServiceService){}
  ngOnInit(){
    this.getPiatti();
  }


  private getPiatti() {
    this.piattiService.dammiAntipasti().subscribe
    (piatti => this.antipasto = piatti);
    this.piattiService.dammiPrimi().subscribe
    (piatti => this.primo = piatti);
    this.piattiService.dammiSecondi().subscribe
    (piatti => this.secondo = piatti);
    this.piattiService.dammiContorni().subscribe
    (piatti => this.contorno = piatti);
    this.piattiService.dammiDolci().subscribe
    (piatti => this.dolce = piatti);
    this.piattiService.dammiSenzaLattosio().subscribe
    (piatti => this.senzaLattosio = piatti);
    this.piattiService.dammiSenzaGlutine().subscribe
    (piatti => this.senzaGlutine = piatti);
    this.piattiService.dammiBevande().subscribe
    (piatti => this.bevanda = piatti);

  }
}
<section class="app-routing-module-container">
  <h3>Antipasti: </h3>
  <app-menu-card *ngFor="let item of antipasto" [piatto]="item"></app-menu-card>

  <h3>Primi: </h3>
  <app-menu-card *ngFor="let item of primo" [piatto]="item"></app-menu-card>

  <h3>Secondi: </h3>
  <app-menu-card *ngFor="let item of secondo" [piatto]="item"></app-menu-card>

  <h3>Contorni: </h3>
  <app-menu-card *ngFor="let item of contorno" [piatto]="item"></app-menu-card>

  <h3>Dolci: </h3>
  <app-menu-card *ngFor="let item of dolce" [piatto]="item"></app-menu-card>

  <h3>Senza Lattosio: </h3>
  <app-menu-card *ngFor="let item of senzaLattosio" [piatto]="item"></app-menu-card>

  <h3>Senza Glutine: </h3>
  <app-menu-card *ngFor="let item of senzaGlutine" [piatto]="item"></app-menu-card>

  <h3>Bevande: </h3>
  <app-menu-card *ngFor="let item of bevanda" [piatto]="item"></app-menu-card>

</section>


<html lang="it">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Carrello</title>
  <style>
    table {
      width: 100%;
      border-collapse: collapse;
      margin-bottom: 20px;
    }

    table, th, td {
      border: 1px solid #ddd;
    }

    th, td {
      padding: 12px;
      text-align: left;
    }

    th {
      background-color: #f2f2f2;
    }

    .checkout-btn {
      padding: 10px 20px;
      font-size: 16px;
      background-color: #4CAF50;
      color: white;
      border: none;
      border-radius: 4px;
      cursor: pointer;
    }
  </style>
</head>
<body>

<h2>Il tuo carrello</h2>

<table>
  <thead>
  <tr>
    <th>Prodotto</th>
    <th>Prezzo</th>
    <th>Quantità</th>
    <th>Totale</th>
  </tr>
  </thead>
  <tbody>
  <tr>
    <td>Prodotto 1</td>
    <td>€20.00</td>
    <td>2</td>
    <td>€40.00</td>
  </tr>
  <tr>
    <td>Prodotto 2</td>
    <td>€15.00</td>
    <td>1</td>
    <td>€15.00</td>
  </tr>
  <!-- Aggiungi altre righe per gli altri prodotti nel carrello -->
  </tbody>
  <tfoot>
  <tr>
    <td colspan="3"><strong>Totale</strong></td>
    <td><strong>€55.00</strong></td>
  </tr>
  </tfoot>
</table>

<button class="checkout-btn">Procedi al pagamento</button>

</body>
</html>
